import React from "react";
import {
  Route,
  HashRouter,
  NavLink,
} from "react-router-dom";

import Mathematics from "./components/Mathematics"

function Courses () {
    return (

      <div>

       <Mathematics />

     <h2>COURSES</h2> 
     <p>Mentee courses will be listed here</p> 
     <ul className="header"> 
     <li><NavLink exact to="/">Mathematics</NavLink></li> 
     </ul> <div className="content"> <Route path="/mathematics" component={Mathematics}/> 
     <li>Mathematics</li> 
     <li>Science</li> 
     <li>Engeeniering</li> 
     <li>Arts</li> 
     <li>Computing</li>
      </div>
      </div>
    )
  }


export default Courses;
